            <img src={Art} height="100%" width="100%"/> 
            </div>

            <div className ="about-4">
            <h2>WHO WE ARE</h2>
            <p>asdsadasdsadsadsadsadasdsad</p>
            </div>

        </div>
    );
};

export default About;
